import './ExploreContainer.css';

const Temp = (props: any) => {
  return (
    <>
       <div className="flex-center mt-10">
        <div className="text-3xl text-green-700">RUMAH</div>
        <div className="mt-10 text-6xl">{props.temp}&deg;</div>
       </div>



    </>
  );
};

export default Temp;
